from collections import Counter
EXECUTIONS_ORDER = [('', Counter('ZERO'), '0'), ('W', Counter('TWO'), '2'), ('U', Counter('FOUR'), '4'), ('X', Counter('SIX'), '6'), ('G', Counter('EIGHT'), '8'), ('O', Counter('ONE'), '1'), ('H', Counter('THREE'), '3'), ('F', Counter('FIVE'), '5'), ('V', Counter('SEVEN'), '7'), ('I', Counter('NINE'), '9')]

def decrypt_encrypted_number(s: str) -> str:
    ans = []
    count = Counter(s)
    executions = iter(EXECUTIONS_ORDER)
    while count:
        (c, word_count, value) = next(executions)
        ans.extend([value] * count[c])
        for _ in range(count[c]):
            count -= word_count
    return ''.join(sorted(ans))

